Append an array using express, Node.js and MongoDB<p>I am new to the MERN stack and I am trying to create users that have an empty queue, which will hold telephone numbers in E.164 format. I aim to populate and remove these numbers from the queue (type: Array) depending on API calls.</p>
<p>The issue is, I am able to update the array, but it overwrites every time the call is made, but I want it to append instead.</p>
<p>The part that I believe I need to amend is <code>user.findByIdAndUpdate(req.params.id,{ '$set' : { queue : req.body.number}}</code> but I am unable to find the way to get it to append instead of update.</p>
<p>I know using <code>.push()</code> will append an array, but how do I implement that within my controller?</p>
<p>Any help is greatly appreciated.</p>
<p><strong>userController.js</strong></p>
<pre><code>var router = express.Router()

var ObjectID = require('mongoose').Types.ObjectId


var { user } = require('../models/user')

router.get('/', (req,res) =&gt; {
    user.find((err,docs) =&gt; {
        (!err) ? res.send(docs) : console.error('Error whilst getting documents : ' + JSON.stringify(err,undefined,2));

    })
})

router.post('/new',(req,res) =&gt; {
    var newRecord = new user ({
        name : req.body.name,
        company : req.body.company,
        email : req.body.email,
        password : req.body.password,
        queue : []

    })

    newRecord.save((err,docs) =&gt; {
        (!err) ? res.send(docs) : console.error('Error whilst creating new user : ' + JSON.stringify(err,undefined,2));
    })
})

router.put('/addToQueue/:id', (req, res) =&gt; {
    if(!ObjectID.isValid(req.params.id))
        return res.status(400).send(&quot;No record exists with given id : &quot; + req.params.id)


    user.findByIdAndUpdate(req.params.id,{ '$set' : { queue : req.body.number}},(err,docs) =&gt; {
        (!err) ? res.send(docs) : console.error('Error updating queue : ' + JSON.stringify(err,undefined,2));
    })
})


module.exports = router
</code></pre>
<p><strong>POSTMAN</strong>
<a href="https://i.stack.imgur.com/WkqLs.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/WkqLs.png" alt="enter image description here" /></a></p>

