<p>The GET route uses several optional parameters that dynamically generate the LINQ query based on which parameters are in the request.  The issue I am having is when filtering by _id it always fails to return data; these attempts include _id.ToString() as well as a simple _id == id comparison.  I have tried several methods of comparing the id parameter and the document _id and none of them have worked.  Having no where clause at all, or filtering by any other fields in the document in any combination all return data as expected.</p>
<p>This is currently what the snippet looks like:</p>
<pre><code> var testId = new ObjectId(id);

 var result = collection.AsQueryable&lt;Terrain&gt;()
                 .Where(t =&gt; t._id.Equals(testId))
                 .Select(t =&gt; t);

  return Json(result);
</code></pre>
<p>This will return an empty result [].  I can only assume I am misunderstanding something about the way _id is being stored being the database and queried here.  For testing purposes, I am getting the value of the parameter id by copying the _id value out of Robo 3T.</p>; Answer: Edited. I used this approach in an enterprise project, where I participate, and it's works more than 8 months in production without problems.

