How can I query all transaction details of the first 50 customers from a MongoDB server?<p>The cluster contains about 240,000 entries of transaction data, inside a local server in my PC.</p>
<p>Cust_ID stands for Customer ID</p>
<p><a href="https://i.stack.imgur.com/5g65l.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/5g65l.png" alt="Sample document structure" /></a></p>
<p>The file contains all transactions done by this customer, followed by transactions done by another customer, and so on. About 3000 customers.</p>
<p>The number of transactions per customer is not the same.</p>
<p>The Cust_IDs are random and unique for each customer, and they are not in any particular order in the cluster.</p>
<p>How can I query the all the transactions made by the first 50 customers in a way where I don't have to manually enter each Customer ID?</p>
<p>By 1st, I mean the following:</p>
<p>Say we have entries like:</p>
<pre><code>{
    Cust_ID: &quot;1001&quot;,
    Name: &quot;ABC&quot;,
    transaction: &quot;1&quot;
}

{
    Cust_ID: &quot;1001&quot;,
    Name: &quot;ABC&quot;,
    transaction: &quot;3&quot;
}

{
    Cust_ID: &quot;1001&quot;,
    Name: &quot;ABC&quot;,
    transaction: &quot;6&quot;
}

{
    Cust_ID: &quot;1092&quot;,
    Name: &quot;BCD&quot;,
    transaction: &quot;23&quot;
}

{
    Cust_ID: &quot;1092&quot;,
    Name: &quot;BCD&quot;,
    transaction: &quot;12&quot;
}

{
    Cust_ID: &quot;2104&quot;,
    Name: &quot;CDE&quot;,
    transaction: &quot;234&quot;
}

{
    Cust_ID: &quot;1004&quot;,
    Name: &quot;DEF&quot;,
    transaction: &quot;3&quot;
}

{
    Cust_ID: &quot;1551&quot;,
    Name: &quot;ASD&quot;,
    transaction: &quot;54&quot;
}

/*The transaction details of 1st 3 customers would be:*/

{
    Cust_ID: &quot;1001&quot;,
    Name: &quot;ABC&quot;,
    transaction: &quot;1&quot;
}

{
    Cust_ID: &quot;1001&quot;,
    Name: &quot;ABC&quot;,
    transaction: &quot;3&quot;
}

{
    Cust_ID: &quot;1001&quot;,
    Name: &quot;ABC&quot;,
    transaction: &quot;6&quot;
} //customer 1

{
    Cust_ID: &quot;1092&quot;,
    Name: &quot;BCD&quot;,
    transaction: &quot;23&quot;
}

{
    Cust_ID: &quot;1092&quot;,
    Name: &quot;BCD&quot;,
    transaction: &quot;12&quot;
} //customer 2

{
    Cust_ID: &quot;2104&quot;,
    Name: &quot;CDE&quot;,
    transaction: &quot;234&quot;
} //customer 3
</code></pre>

